  getTrimmedBlocksForPage(pageNumber: number, bookTitle?: string, isSlowMode?: boolean): TrimmedBlockData | null {
    
    // If slow mode is enabled, try to get slow version first
    if (isSlowMode) {
      if (bookTitle && (bookTitle.toLowerCase().includes('demo') || bookTitle.toLowerCase().replace(/\s+/g, '_').includes('demo_book'))) {
        const slowData = this.demoSlowDataMap.get(pageNumber);
        if (slowData) {
          return slowData;
        }
        console.warn(`[TrimmedBlocksDataService] Slow trimmed blocks not available for page ${pageNumber}, using normal version`);
      } else if (!bookTitle || bookTitle.toLowerCase().includes('grade 3') || bookTitle.toLowerCase().includes('grade_3')) {
        const slowData = this.grade3SlowDataMap.get(pageNumber);
        if (slowData) {
          return slowData;
        }
        console.warn(`Slow trimmed blocks not available for page ${pageNumber}, using normal version`);
      } else if (bookTitle.toLowerCase().includes('grade 5') || bookTitle.toLowerCase().includes('grade_5')) {
        const slowData = this.grade5SlowDataMap.get(pageNumber);
        if (slowData) {
          return slowData;
        }
        console.warn(`Slow trimmed blocks not available for page ${pageNumber}, using normal version`);
      } else if (bookTitle.toLowerCase().includes('grade 6') || bookTitle.toLowerCase().includes('grade_6')) {
        const slowData = this.grade6SlowDataMap.get(pageNumber);
        if (slowData) {
          return slowData;
        }
        console.warn(`Slow trimmed blocks not available for page ${pageNumber}, using normal version`);
      } else if (bookTitle.toLowerCase().includes('grade 7') || bookTitle.toLowerCase().includes('grade_7')) {
        const slowData = this.grade7SlowDataMap.get(pageNumber);
        if (slowData) {
          return slowData;
        }
        console.warn(`Slow trimmed blocks not available for page ${pageNumber}, using normal version`);
      }
    }
    
    // Determine which data map to use based on book title
    let dataMap: Map<number, TrimmedBlockData>;
    let mapType = 'unknown';
    
    if (bookTitle && (bookTitle.toLowerCase().includes('demo') || bookTitle.toLowerCase().replace(/\s+/g, '_').includes('demo_book'))) {
      dataMap = this.demoDataMap;
      mapType = 'demo';
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 4') || bookTitle.toLowerCase().includes('grade_4'))) {
      dataMap = this.grade4DataMap;
      mapType = 'grade4';
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 5') || bookTitle.toLowerCase().includes('grade_5'))) {
      dataMap = this.grade5DataMap;
      mapType = 'grade5';
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 6') || bookTitle.toLowerCase().includes('grade_6'))) {
      dataMap = this.grade6DataMap;
      mapType = 'grade6';
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 7') || bookTitle.toLowerCase().includes('grade_7'))) {
      dataMap = this.grade7DataMap;
      mapType = 'grade7';
    } else {
      // Default to Grade 3 for backward compatibility
      dataMap = this.grade3DataMap;
      mapType = 'grade3';
    }
        
    const data = dataMap.get(pageNumber);
    if (data) {
      return data;
    } else {
      console.warn(`[TrimmedBlocksDataService] No trimmed blocks data found for page ${pageNumber} in ${bookTitle || 'Grade 3 book'}`);
      return null;
    }
  }

  hasDataForPage(pageNumber: number, bookTitle?: string): boolean {
    if (bookTitle && (bookTitle.toLowerCase().includes('demo') || bookTitle.toLowerCase().replace(/\s+/g, '_').includes('demo_book'))) {
      return this.demoDataMap.has(pageNumber);
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 4') || bookTitle.toLowerCase().includes('grade_4'))) {
      return this.grade4DataMap.has(pageNumber);
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 5') || bookTitle.toLowerCase().includes('grade_5'))) {
      return this.grade5DataMap.has(pageNumber);
    // } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 6') || bookTitle.toLowerCase().includes('grade_6'))) {
    //   return this.grade6DataMap.has(pageNumber);
    } else {
      return this.grade3DataMap.has(pageNumber);
    }
  }

  getAvailablePages(bookTitle?: string): number[] {
    if (bookTitle && (bookTitle.toLowerCase().includes('demo') || bookTitle.toLowerCase().replace(/\s+/g, '_').includes('demo_book'))) {
      return Array.from(this.demoDataMap.keys());
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 4') || bookTitle.toLowerCase().includes('grade_4'))) {
      return Array.from(this.grade4DataMap.keys());
    } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 5') || bookTitle.toLowerCase().includes('grade_5'))) {
      return Array.from(this.grade5DataMap.keys());
    // } else if (bookTitle && (bookTitle.toLowerCase().includes('grade 6') || bookTitle.toLowerCase().includes('grade_6'))) {
    //   return Array.from(this.grade6DataMap.keys());
    } else {
      return Array.from(this.grade3DataMap.keys());
    }
  }
